import React from 'react';
import UsersView from './UserView';

const UserList = ({ allUsers, onClick }) => (
  <ul>
    {allUsers &&
      allUsers.map(user => (
        <li key={user.name}>
          <UsersView key={user.id} user={user} onC />
        </li>
      ))}
  </ul>
);

export default UserList;
